import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import './Home.css'; // optional, for extra styling

const Home = () => {
  return (
    <div className="home-container">
      <div className="home-card">
        <h1>Welcome to Complaint Chain</h1>
        <p>
          Submit complaints, track their progress, and stay updated with public services efficiently.
          Start by creating an account or logging in.
        </p>
        <div className="d-flex flex-column flex-md-row justify-content-center gap-3">
          <a href="/register" className="btn btn-primary btn-lg w-100 w-md-auto">
            Register
          </a>
          <a href="/login" className="btn btn-secondary btn-lg w-100 w-md-auto">
            Login
          </a>
        </div>
      </div>
    </div>
  );
};

export default Home;
